import "./section.css"

function Section({ title, children }) {
    return (
        <div className="section">
            <h2>{title}</h2>
            {children}
        </div>
    );
}

function Subsection({ title, children }) {
    return (
        <div className="subsection">
            <br/><br/>
            <h3 style={{fontWeight: 'bold'}}>{title}</h3>
            {children}
        </div>
    );
}

export {Section, Subsection};
